import React from 'react';
import pass from './password.png';
import {NavLink} from "react-router-dom";
import './Signup.css';
import {useState, useEffect} from "react";
import Axios from "axios";

function Signup() {

  const [usname , Setusname] = useState("");
  const [passc , Setpassc] = useState("");

  const[userList , setuserList] = useState([]);

  useEffect(() => {
    Axios.get("http://localhost:3001/userdet").then((response) => {
      setuserList(response.data);
    });
  },[]);

  const putdata = () => {
    Axios.post("http://localhost:3001/puttable", {usname: usname , passc: passc}).then((response) => {
      userList.map((val) => {
        return val.username === usname ? (val.password === passc ? <App /> : <Login />) : <Login/>;
      });
    });
  };

  return (
    <div className="outer1">
        <div className="inner1">
            <div className="upper">
                <img src={pass} />
                <div className="up"> Pass-Man </div>
            </div>
            <div className="nam112">Sign-Up</div>
            <div className="nam111">Already have an account <NavLink to="/Login">Click here</NavLink></div>
            <input type="text" className="uname1" placeholder="Enter Username" onChange={(event) => {
              Setusname(event.target.value);
            }}/>
            <input type="text" className="pass1" placeholder="Enter Password" onChange={(event) => {
              Setpassc(event.target.value);
            }}/>
            <button className="but1" onClick={putdata}>SignUp</button>
        </div>
    </div>
  );
};

export default Signup;
